import React from 'react';

const GameLog = ({ moves }) => {
    return (
    <div className="game-log">
        <h3>Move History</h3>
        <ul>
        {moves.map((move, index) => (
            <li key={index}>{move}</li>
        ))}
        </ul>
    </div>
    );
};

export default GameLog;
